    return (
      <div className="p-6">
        <h1 className='text-center lg:text-4xl md:text-3xl sm:text-2xl font-bold pb-5'>Contact Us</h1>
        <p className='font-semibold text-justify lg:text-lg md:text-md pb-5'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Lorem ipsum dolor sit, amet consectetur adipisicing elit. Eaque, sit. Corrupti libero error quibusdam ad. Nihil reprehenderit odio inventore mollitia ducimus ipsa animi cupiditate beatae ipsum impedit quidem, dolore officia. Lorem ipsum dolor sit amet consectetur adipisicing elit. Ex, debitis consequuntur, ad magnam quam sit quas perspiciatis alias nemo laudantium cumque asperiores minima sed nulla illo pariatur. Expedita, voluptate soluta. Lorem ipsum dolor sit amet consectetur adipisicing elit. Odio corrupti, voluptates fuga nam accusantium vero pariatur eaque. Asperiores, earum pariatur. Molestiae aperiam facilis veritatis. Explicabo cupiditate odit asperiores molestias accusantium! Lorem ipsum dolor sit, amet consectetur adipisicing elit. Consequatur inventore totam atque mollitia vel, suscipit magni enim quo ipsa explicabo fuga, quisquam nulla quas quaerat cum neque voluptas id perspiciatis.</p>
        <div className='grid grid-col-2 gap-4'>
          <form className='w-full py-6 px-16 flex flex-col space-y-8'>
            <TextField
            label='Email'
            type='email'
            variant='outlined'
            placeholder='Enter Your Email Address'
            fullWidth={true}
            required
            />
             <TextField
            label='Message'
