            fullWidth={true}
            multiline
            minRows={5}
            maxRows={Infinity}
            required
            />
            <button className='bg-purple-800 text-white py-3 font-bold text-xl rounded-lg'>Submit</button>
          </form>
        </div>
      </div>
    );
  }
}
